import React, {Component} from 'react';
import "./_logo.scss"

class Logo extends Component
{
    render() {
        return (
            <>
                <header className="logo">
                    <div className="container logo-cont">
                        <section className="logo-content"/>
                    </div>
                </header>
            </>
        )
    }
}

export default Logo;
